import React, { useEffect} from "react";
import {useAuth} from "react-use-auth";
const Auth0Callback = () => {
  const { handleAuthentication} = useAuth();
  useEffect(()=> {
    handleAuthentication();
  }, []);


  return (
    <div>Hello</div>
    )
}
export default Auth0Callback;
